snippet.description:
👉SCARICA OPERA GX GRATUITAMENTE DA QUI: https://operagx.gg/Playerinside5
---
Una domenica un po' melanconica. Ma anche malinconica. Insomma, quel "melanconica" forse l'ho usato un po' a sproposito ma credo, signori, di aver reso l'idea. BUONA DOMENICA con le NEWS DELLA SETTIMANA. Almeno per quasi venti minuti siamo tutti contenti, magari sulla "tazza".

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Intro con domanda;
0:42 - SPONSOR: Opera GX;
2:54 - Stop Destroying Videogames: l'UE approva le firme;
3:45 - GTA 6 al lancio solo in versione digitale? Quando uscirà la versione fisica?
5:08 - È questo il nuovo controller per PlayStation 6?
6:23 - Xbox in crisi? GamePass e console in netto calo?
6:46 - I prossimi giochi Xbox saranno tutti multipiattaforma;
7:34 - Gli sviluppatori preferiscono Switch 2, PS5 e PC;
7:53 - Highguard: gli sviluppatori non si aspettavano tutto quest'odio;
9:00 - Highguard: il team modifica la descrizione su steam e aggiunge il 5 vs 5;
10:11 - Elden Ring Nightreign: il DLC The Forsaken Hollows bombardato di recensioni negative su Steam;
10:35 - Dispatch censurato su Switch 2: di chi è la colpa?
11:33 - Assassin's Creed Invictus: ecco che cos'è (purtroppo);
12:23 - Prince of Persia remake: l'attrice coprotagonista scopre della cancellazione dal web;
12:34 - Ubisoft: i dipendenti odiano il CEO e propongono uno sciopero;
13:15 - Beyond Good & Evil 2: il gicoo sarebbe ancora "vivo e vegeto";
13:53 - Resident Evil Requiem: le azioni di Grace e Leon saranno collegate;
14:17 - Anche nel mondo degli indie c'è del marcio;
14:55 - Silent Hill: un altro capitolo in sviluppo oltre al remake del primo;
15:23 - NEWS A RAFFICA;
18:37 - Saluti
…
- Raiden & Midna

#ADV

